import './blog.css';
import React from 'react'
import { Article } from '../../components';

export const Blog = () => {
  return (
    <div className="gpt3_blog section_padding" id="blog">
      <div className="gpt3_blog-heading">
        <h1 className="gradient_text">A Lot is Happening <br />We are Blogging about it</h1>
      </div>
      <div className="gpt3_blog-container">
        <div className="gpt3_blog-container-groupA">
          <Article imgUrl={blog01} date ="March-22-2022" text="Lorem ipsum dolor sit amet consectetur adipisicing elit. Saepe, deserunt"/>

        </div>
      </div>
    </div>
  )
}
